public struct NavigoStationInfo {
    let name: String
    let provider_id: Int
    let provider_name: String
    let group: Int
    let id: Int
    let sub: Int
    let mode: String
    let lat: Double
    let long: Double
    let found: Bool
    
    init(name: String, provider_id: Int, provider_name: String, group: Int, id: Int, sub: Int, mode: String, lat: Double, long: Double) {
        self.name = name
        self.provider_id = provider_id
        self.provider_name = provider_name
        self.group = group
        self.id = id
        self.sub = sub
        self.mode = mode
        self.lat = lat
        self.long = long
        self.found = true
    }
    
    init(name: String, provider_id: Int, provider_name: String, group: Int, id: Int, sub: Int, mode: String, lat: Double, long: Double, found: Bool) {
        self.name = name
        self.provider_id = provider_id
        self.provider_name = provider_name
        self.group = group
        self.id = id
        self.sub = sub
        self.mode = mode
        self.lat = lat
        self.long = long
        self.found = found
    }
}

public class NavigoStations {
    public class func find(_ provider: Int, _ group: Int, _ id: Int, _ sub: Int, _ mode: String) -> NavigoStationInfo? {
        if (provider == 2) { // Map SNCF Provider
            return NavigoStations.allStations.first { $0.provider_id == 1 && $0.group == group && $0.id == id && $0.sub == sub && $0.mode == mode }
        }
        else if (provider == 3) { // Map RATP Provider
            return NavigoStations.allStations.first { $0.provider_id == 59 && $0.group == group && $0.id == id && $0.sub == sub && $0.mode == mode }
        }
        if let station = NavigoStations.allStations.first(where: { $0.provider_id == provider && $0.group == group && $0.id == id && $0.sub == sub && $0.mode == mode }) {
            return station
        }
        return NavigoStations.allStations.first { $0.group == group && $0.id == id && $0.sub == sub && $0.mode == mode }
    }
    
